  return (
    <header>
      <Link to="/" className="logo">
        Mantul <span>.</span>
      </Link>
      <nav>
        {NavbarData.map((yo, index) => {
          return (
            <>
            <Link key={index} to={yo.to}>
              {yo.title}
            </Link>
            <div className="sing">

            </div>
            </>
          );
        })}
      </nav>
    </header>
  );
}

export default Navbar;
